```json
{
  "application": "PBS",
  "details": {
    "software": [
      "Singularity",
      "qsub"
    ],
    "resources": {
      "nodes": 1,
      "cpus": 1,
      "memory": "10GB",
      "walltime": "120:00:00",
      "queue": "normal",
      "project": "personal"
    },
    "files": [
      "*.parquet",
      "path/to/qsmooth-submit.pbs"
    ]
  }
}
```

This script uses PBS (Portable Batch System) to manage job submission and execution. It leverages Singularity for containerized execution. The script processes a large number of parquet files, splitting them into small and big files based on size. It submits jobs to process these files using qsub and dynamically manages job submission based on file size and a predefined schedule. The script also checks for the existence of output files to prevent redundant processing.
